import DeleteIcon from '@mui/icons-material/Delete';
import './index.css'

 const ListCom =(props)=>{

    const cutIt =()=>{
       line = true 
    }

     return (
         <div className='list-style'>
             <span onClick={cutIt}>
               <DeleteIcon className='delete' />
             </span>
             <li style={{textDecoration: line? "line-through" : "none"}}>{props.target}</li>
         </div>
     )
 }
 export default ListCom
